    <script src="https://cdn.bootcss.com/echarts/3.5.2/echarts.common.js"></script>
    <script type="text/javascript">

        $(document).ready(function(){
            $(".screenshot").on('click', function () {
                var title = this.title;
                var dw = window.open();
                dw.document.open();
                dw.document.write("<image width='100%' src=" + "'" + title + "'" + ">");
                dw.document.close();
            });



            $('td').on('click', '.btn.btn-default.btn-xs.view', function(e){
                e.preventDefault();
                var $this = $(this);
                var $nextRow = $this.closest('tr').next('tr');
                $nextRow.slideToggle("fast");
                $this.text(function(i, text){
                    if (text === 'View') {
                        return 'Hide';
                    } else {
                        return 'View';
                    }
                });
            });
            // 基于准备好的dom，初始化echarts实例
            var myChart = echarts.init(document.getElementById('main'));
            var success = parseInt($("#success").html());
            var failed = parseInt($("#failed").html());
            var error = parseInt($("#error").html());
            var skip = parseInt($("#skip").html());
            // 指定图表的配置项和数据
            var option = {
                    title : {
                        text: '自动化测试',
                        subtext: '通过率',
                        x:'center'
                    },
                    tooltip : {
                        trigger: 'item',
                        formatter: "{a} <br/>{b} : {c} ({d}%)"
                    },
                    legend: {
                        orient: 'vertical',
                        left: 'right',
                        data: ['成功','失败','出错','跳过']
                    },
                    series : [
                        {
                            name: '数量',
                            type: 'pie',
                            radius : '55%',
                            center: ['50%', '60%'],
                            data:[
                                {value:success, name:'成功'},
                                {value:failed, name:'失败'},
                                {value:error, name:'出错'},
                                {value:skip, name:'跳过'}
                            ],
                            color: ['#5cb85c', '#d9534f','#f0ad4e','#5bc0de'],
                            itemStyle: {
                                emphasis: {
                                    shadowBlur: 10,
                                    shadowOffsetX: 0,
                                    shadowColor: 'rgba(0, 0, 0, 0.5)'
                                }
                            }
                        }
                    ]
                };

            // 使用刚指定的配置项和数据显示图表。
            myChart.setOption(option);


        });



    </script>
